import "./App.css";
import Index from "./Pages/Index";
import Login from "./Pages/Login";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route path="/home" element={<Index />} />
        <Route path="/" element={<Login />} />
      </BrowserRouter>
    </div>
  );
}

export default App;
